values ('5027227560974a17a6391312d182c62a', 'U0010000001', to_timestamp('16-07-2014 10:54:04.785000', 'dd-mm-yyyy hh24:mi:ss.ff'), 'U0010000001', to_timestamp('25-07-2014 02:15:43.792000', 'dd-mm-yyyy hh24:mi:ss.ff'), null, '249ebde3-add9-4dbe-9b8a-6cbaa2485a56', null, null, '辐射安全许可证（仅限销售、使用Ⅳ、Ⅴ类放射源和生产、销售、使用Ⅲ类射线装置单位）', '350200004139501A130000', '{"1":"普通项目"}', null, null, null, null, null, '{"004139501":"厦门市环境保护局"}', '{"D0000000026":"厦门市环境保护局"}', null, null, '1', null, '004139501', '辐射安全许可证（仅限销售、使用Ⅳ、Ⅴ类放射源和生产、销售、使用Ⅲ类射线装置单位）', null, '{"1":"行政许可事项"}', '厦门市环境保护局各驻区分局', '（1）Ⅲ类射线装置和Ⅳ、V类放射源的辐射工作单位应当有1名具有大专以上学历的技术人员专职或者兼职负责辐射安全与环境保护管理工作。 （2）从事辐射工作的人员必须通过辐射安全和防护专业知识及相关法律法规的培训和考核。 （3）使用放射性同位素的单位应当有满足辐射防护和实体保卫要求的放射源暂存库或设备。 （4）放射性同位素与射线装置使用场所有防止误操作、防止工作人员和公众受到意外照射的安全措施。 （5）配备与辐射类型和辐射水平相适应的防护用品和监测仪器，包括个人剂量测量报警、辐射监测等仪器。使用非密封放射性物质的单位还应当有表面污染监测仪。 （6）有健全的操作规程、岗位职责、辐射防护和安全保卫制度、设备检修维护制度、放射性同位素使用登记制度、人员培训计划、监测方案等。 （7）有完善的辐射事故应急措施。 （8）产生放射性废气、废液、固体废物的，还应具有确保放射性废气、废液、固体废物达标排放的处理能力或者可行的处理方案。 使用放射性同位素和射线装置开展诊断和治疗的单位，还应当配备质量控制检测设备，制定相应的质量保证大纲和质量控制检测计划，至少有一名医用物理人员负责质量保证与质量控制检测工作。', '004139501', '（1）《中华人民共和国放射性污染防治法》（2）《放射性同位素与射线装置安全和防护条例》（3）《放射性同位素与射线装置安全许可管理办法》（4）《福建省环保局关于委托开展辐射安全许可证行政许可工作的通知》（5）《福建省环保厅关于进一步明确核技术应用项目辐射安全审批职责的通知》', null, '20007', '{"3":"个人和单位"}', '{"20007":"辐射安全许可证"}', '{"2":"证照"}', '{"D0000000026":"厦门市环境保护局"}', '分为正本和副本，有效期为5年。有效期届满，需要延续的，应当于许可证有效期届满30日前向原发证机关提出延续申请。', '{"004139501":"厦门市环境保护局"}', '{"2":"承诺件"}', null, '7个工作日', null, null, null, null, null, '{}', null, '{"XZSP_TEMPLATE":"行政审批串联流程模板"}', '{}', null, 'XZSP_TEMPLATE', '{}', '{"0":"不显示工程图列表"}', '{"1":"启用"}', '{"0":"不外网显示"}', null, null, '{}', null, '普通项目', '1', '行政许可事项', '1', '承诺件', '2', '{"1":"审批"}', '审批', '个人和单位', '厦门市环境保护局', 'D0000000026', '厦门市环境保护局', 'D0000000026', '2', '厦门市环境保护局', '证照', null, '辐射安全许可证', null, null, null, '行政审批串联流程模板', null, '不显示工程图列表', '0', '启用', '1', '不外网显示', '0', '3', '厦门市环境保护局');
