values ('82381198ada844af89e359162c673de7', 'U0010000001', to_timestamp('17-06-2014 10:36:45.572000', 'dd-mm-yyyy hh24:mi:ss.ff'), 'U0010000001', to_timestamp('25-07-2014 01:23:09.724000', 'dd-mm-yyyy hh24:mi:ss.ff'), null, '249ebde3-add9-4dbe-9b8a-6cbaa2485a56', null, null, '城市排水许可（项目接管、接口）', '350200004136423A010400', '{"1":"普通项目"}', null, null, null, null, null, '{"004136423":"厦门市市政园林局"}', '{"D0000000051":"厦门市市政园林局"}', ' 7703805', '20个工作日', '1', null, '004136423', '准许申请人的排水管网与城市公共排水管网连通。准予的发《项目雨水、污水接入市政管网确认书》。《送达回证》；不准予的发《不予批准通知书》和《送达回证》。', '工作日9:00-12:00,13:00-17:00 ', '{"1":"行政许可事项"}', '厦门市政务服务中心三楼B厅建设综合服务区', '提出排水许可申请，并填写《排水许可申请表》；污水排放口的设置符合城市排水专业规划的要求；内部排水设施、污水排放口的设置符合城市排水专业规划的要求；向城市排水设施排放的污水，符合《污水综合排放标准》（GB8978）、《污水排入城市下水道水质标准》（CJ3082）和厦门市污水排入城市排水设施的有关标准和规定；已按规定建设相应的污水处理设施；已在排放口设置专用检测井；排放污水可能对城市排水设施正常运行造成危害的重点排污工业企业，已在排放口安装至少能对水量、pH，CODcr（或TOC）进行检测的在线检测装置；其他重点排污工业企业和重点排水户，具备至少能对水量、pH，CODcr，SS和氨氮等进行检测的能力和相应的水量、水质检测制度；对各类施工作业临时排水中有沉淀物，足以造成排水设施堵塞或者损坏的，排水户已修建预沉设施，且排水经预沉设施处理后符合第3条规定的标准；施工单位应具备相应的施工资质；监理单位对工程质量评为合格以上。(法律依据：第a-i项依据《建设部关于纳入国务院决定的十五项行政许可的条件的规定》第六项) ', '004136423', '《国务院对确需保留的行政审批项目设定行政许可的决定》（国务院令第412号，2004年）；《城市排水许可管理办法》（中华人民共和国建设部令第152号，2006年）；《厦门市市政工程设施管理条例》第32条，1997年。', null, '20010', '{"3":"个人和单位"}', '{"20010":"排水许可证"}', '{"2":"证照"}', '{"D0000000051":"厦门市市政园林局"}', null, '{"004136423":"厦门市市政园林局"}', '{"2":"承诺件"}', null, '7个工作日（不包含勘察现场的3个工作日）', null, null, null, null, null, '{}', null, '{"XZSP_TEMPLATE":"行政审批串联流程模板"}', '{}', null, 'XZSP_TEMPLATE', '{}', '{"0":"不显示工程图列表"}', '{"1":"启用"}', '{"0":"不外网显示"}', null, null, '{}', null, '普通项目', '1', '行政许可事项', '1', '承诺件', '2', '{"1":"审批"}', '审批', '个人和单位', '厦门市市政园林局', 'D0000000051', '厦门市市政园林局', 'D0000000051', '2', '厦门市市政园林局', '证照', null, '排水许可证', null, null, null, '行政审批串联流程模板', null, null, null, '启用', '1', null, null, '3', '厦门市市政园林局');
