values ('da1c0e3d77a94354b523ee848e597a66', 'U0010000001', to_timestamp('12-06-2014 17:18:36.524000', 'dd-mm-yyyy hh24:mi:ss.ff'), 'U0010000001', to_timestamp('21-07-2014 21:56:45.739000', 'dd-mm-yyyy hh24:mi:ss.ff'), null, '249ebde3-add9-4dbe-9b8a-6cbaa2485a56', null, null, '建设工程结合民用建筑修建的防空地下室竣工验收', '350200004138824A080000', '{"1":"普通项目"}', null, null, null, '黄群', '易地建设费', '{"004138824":"厦门市人民防空办公室（市民防局）"}', '{"D0000000173":"厦门市民防局"}', '7703793 13616052004', '20个工作日', '1', null, '004138824', '《厦门市防空地下室竣工验收意见书》', '工作日9:00-12:00,13:00-17:00', '{"1":"行政许可事项"}', '厦门市政务服务中心三楼B厅建设综合服务区', '1、建设工程已完成工程设计和合同约定的各项内容，有完整的工程技术档案和施工管理资料； 2、对照相关要求自查整改完毕，申请材料完整、准确，申请表格经核对填写无误； 3、施工单位在工程完工后对工程质量进行了检查，确认工程质量符合工程建设强制性标准，达到设计文件及合同要求； 4、监理单位对工程质量进行了评价； 5、勘察设计单位对勘察设计文件及施工过程中由设计单位签署的设计变更通知书进行了确认； 6、人防行政主管部门及其工程质量监督站等有关部门责令整改的问题全部整改完毕。', '004138824', '《福建省人民防空条例》第十九条，《人民防空工程建设管理规定》（[2003]国人防办字第18号）第三十七条、第三十八条，《福建省防空地下室竣工验收备案管理暂行规定》（闽人防办[2010]49号），《厦门市人民防空管理办法》第二十二条。', null, '30011', '{"2":"单位"}', '{"30011":"行政许可意见书"}', '{"1":"批复"}', '{"D0000000173":"厦门市民防局"}', null, '{"004138824":"厦门市人民防空办公室（市民防局）"}', '{"2":"承诺件"}', '《福建省规范防空地下室易地建设收费实施办法》（闽价[2002]房133号、闽价[2003]房208号）', '7个工作日', '1、防护等级五级的防空地下室：思明区、湖里区、海沧区、集美区为2000元/平方米，同安区、翔安区为1400元/平方米；', '市民防局', null, null, null, '{}', null, '{"XZSP_TEMPLATE":"行政审批串联流程模板"}', '{}', null, 'XZSP_TEMPLATE', '{}', '{"0":"不显示工程图列表"}', '{"1":"启用"}', '{"0":"不外网显示"}', null, null, '{}', null, '普通项目', '1', '行政许可事项', '1', '承诺件', '2', '{"1":"审批"}', '审批', '单位', '厦门市人民防空办公室（市民防局）', 'D0000000173', '厦门市民防局', 'D0000000173', '1', '厦门市人民防空办公室（市民防局）', '批复', null, '行政许可意见书', null, null, null, '行政审批串联流程模板', null, '不显示工程图列表', '0', '启用', '1', '不外网显示', '0', '2', '厦门市民防局');
