values ('d38d56fa683e41b091533760adad9aed', 'U0010000001', to_timestamp('16-06-2014 17:47:34.661000', 'dd-mm-yyyy hh24:mi:ss.ff'), 'U0010000001', to_timestamp('25-07-2014 02:06:57.352000', 'dd-mm-yyyy hh24:mi:ss.ff'), null, '249ebde3-add9-4dbe-9b8a-6cbaa2485a56', null, null, '建设项目（含海岸工程）环境影响评价文件许可（环境影响报告书、环境影响报告表或环境影响登记表）', '350200004139501A100000', '{"1":"普通项目"}', null, null, null, null, null, '{"004139501":"厦门市环境保护局"}', '{"D0000000026":"厦门市环境保护局"}', '7703794', null, '1', null, '004139501', '建设项目（含海岸工程）环境影响评价文件许可（环境影响报告书、环境影响报告表或环境影响登记表）', '工作日9:00-12:00,13:00-17:00', '{"1":"行政许可事项"}', '厦门市政务服务中心三楼B厅建设综合服务区', '（1）必须符合国家产业政策，不属于国家及地方淘汰或禁止项目。（2）必须符合城乡规划、土地利用总体规划、产业布局规划以及厦门市环境功能区划（含海洋）和生态功能区划。（3）必须符合节能减排、清洁生产要求。（4）必须符合环境质量标准和污染物排放标准。（5）必须满足国家和厦门市规定的污染物排放总量控制要求，能够改善或维持区域环境质量。① 排放二氧化硫和氮氧化物的，需要有项目所在地环保分局出具的排污总量来源证明；② 排放污水的，必须进入城市污水处理厂，或者实现采用节水及循环利用工艺，或者通过污水回灌山体绿地林地实现资源化或零排放，环保部门认为不具备上述条件的除外。（6）必须符合环境整治和生态恢复要求，改建、扩建项目必须采取措施，治理原有的污染源。（7）必须符合国家、福建省和厦门市有关政策、法律、法规、规章的其它规定。各级环境保护行政主管部门一律不得受理和审批涉及以下六类项目的环境影响评价文件：① 国家明令淘汰、禁止建设的项目；② 环境污染严重、污染物不能达标排放的项目；③ 所在区域环境质量不能满足环境功能区要求的项目；④ 位于自然保护区核心区、缓冲区内的项目；⑤ 在饮用水源一级保护区内与供水设施和保护水源无关的项目，或在二级保护区内排放污染物的项目；⑥ 不符合省政府流域水环境综合整治要求的项目。（8）对环境可能造成重大影响，需要编制环境影响报告书的建设项目以及其他需要征求公众意见的报告表、登记表项目，需举行论证会、听证会或采取其他方式征求有关单位、专家和公众的意见，但国家规定需要保密的情形除外。（9）对污染物排放总量较大或所在位置敏感的建设项目，根据有关环保法律法规规定，环保部门可以要求建设单位组织专家对环境影响评价文件进行评审。（10）对于法律、法规没有明确规定的部分具体情况，可以环境影响评价文件的科学结论或专家论证会的意见对建设项目进行审批。（11）环境影响评价文件的等级要符合《建设项目环境影响评价分类管理名录》的规定；环境影响报告书要达到《环境影响评价技术导则》规定的深度要求；环境影响报告表、环境影响登记表按照国家环保部规定的格式和内容编写；环评总体结论应为支持项目建设。', '004139501', null, null, '在环境影响评价文件批复中书面审批', '{"3":"个人和单位"}', '{"在环境影响评价文件批复中书面审批":"在环境影响评价文件批复中书面审批"}', '{"1":"批复"}', '{"D0000000026":"厦门市环境保护局"}', '无有效期限和年审规定', '{"004139501":"厦门市环境保护局"}', '{"2":"承诺件"}', null, '环境影响报告书10个工作日、环境影响报告表7个工作日、环境影响登记表3个工作日。', null, null, null, null, null, '{}', null, '{"XZSP_TEMPLATE":"行政审批串联流程模板"}', '{}', null, 'XZSP_TEMPLATE', '{}', '{"0":"不显示工程图列表"}', '{"1":"启用"}', '{"0":"不外网显示"}', null, null, '{}', null, '普通项目', '1', '行政许可事项', '1', '承诺件', '2', '{"1":"审批"}', '审批', '个人和单位', '厦门市环境保护局', 'D0000000026', '厦门市环境保护局', 'D0000000026', '1', '厦门市环境保护局', '批复', null, '在环境影响评价文件批复中书面审批', null, null, null, '行政审批串联流程模板', null, '不显示工程图列表', '0', '启用', '1', '不外网显示', '0', '3', '厦门市环境保护局');
