values ('f322af18ca954249a1ec3db4665c9ee0', 'U0010000001', to_timestamp('17-06-2014 10:59:42.101000', 'dd-mm-yyyy hh24:mi:ss.ff'), 'U0010000001', to_timestamp('25-07-2014 02:03:25.428000', 'dd-mm-yyyy hh24:mi:ss.ff'), null, '249ebde3-add9-4dbe-9b8a-6cbaa2485a56', null, null, '危险废物经营许可（危险废物收集经营许可证或医疗废物集中处置单位的危险废物经营许可证）', '350200004139501A020000', '{"1":"普通项目"}', null, null, null, null, null, '{"004139501":"厦门市环境保护局"}', '{"D0000000026":"厦门市环境保护局"}', '7703794', null, '1', null, '004139501', '危险废物经营许可（危险废物收集经营许可证或医疗废物集中处置单位的危险废物经营许可证）', '工作日9:00-12:00,13:00-17:00', '{"1":"行政许可事项"}', '厦门市政务服务中心三楼B厅建设综合服务区', '1.1 医疗废物集中处置单位的危险废物经营许可证核发（1）有3名以上环境工程专业或者相关专业中级以上职称，并有3年以上固体废物污染治理经历的技术人员；(2）有符合国务院交通主管部门有关危险货物运输安全要求的运输工具；（3）有符合国家或者地方环境保护标准和安全要求的包装工具，中转和临时存放设施、设备以及经验收合格的贮存设施、设备；（4）有符合国家或者省、市危险废物处置设施建设规划，符合国家或者地方环境保护标准和安全要求的处置设施、设备和配套的污染防治设施；其中，医疗废物集中处置设施，还应当符合国家有关医疗废物处置的卫生标准和要求；（5）有与所经营的危险废物类别相适应的处置技术和工艺；（6）有保证危险废物经营安全的规章制度、污染防治措施和事故应急救援措施；（7）以填埋方式处置危险废物的，应当依法取得填埋场所的土地使用权。（《危险废物经营许可证管理办法》第五条）1.2 危险废物收集经营许可证核发（1）防雨、防渗的运输工具；（2）符合国家或者地方环境保护标准和安全要求的包装工具，中转和临时存放设施、设备；（3）保证危险废物经营安全的规章制度、污染防治措施和事故应急救措施。（《危险废物经营许可证管理办法》第六条）', '004139501', '（1）《中华人民共和国固体废物污染环境防治法》（2）《危险废物经营许可证管理办法》', null, null, '{"2":"单位"}', '{}', '{"1":"批复"}', '{"D0000000026":"厦门市环境保护局"}', '书面审批。危险废物综合经营许可证有效期5年；危险废物收集经营许可证有效期3年。无年审规定。', '{"004139501":"厦门市环境保护局"}', '{"2":"承诺件"}', null, '7个工作日（不包含商经函、听证、招标、拍卖、检验、检测、检疫、鉴定和专家评审、现场勘查、补件、上报等特殊环节所需要的时间）。', null, null, null, null, null, '{}', null, '{"XZSP_TEMPLATE":"行政审批串联流程模板"}', '{}', null, 'XZSP_TEMPLATE', '{}', '{"0":"不显示工程图列表"}', '{"1":"启用"}', '{"0":"不外网显示"}', null, null, '{}', null, '普通项目', '1', '行政许可事项', '1', '承诺件', '2', '{"1":"审批"}', '审批', '单位', '厦门市环境保护局', 'D0000000026', '厦门市环境保护局', 'D0000000026', '1', '厦门市环境保护局', '批复', null, null, null, null, null, '行政审批串联流程模板', null, '不显示工程图列表', '0', '启用', '1', '不外网显示', '0', '2', '厦门市环境保护局');
