values ('7454181c571545f8adca9c57070da067', 'U0010000001', to_timestamp('17-06-2014 12:02:08.328000', 'dd-mm-yyyy hh24:mi:ss.ff'), 'U0010000001', to_timestamp('25-07-2014 02:06:40.029000', 'dd-mm-yyyy hh24:mi:ss.ff'), null, '249ebde3-add9-4dbe-9b8a-6cbaa2485a56', null, null, '废弃电器电子产品处理资格的许可', '350200004139501A070000', '{"1":"普通项目"}', null, null, null, null, null, '{"004139501":"厦门市环境保护局"}', '{"D0000000026":"厦门市环境保护局"}', '7703794', null, '1', null, '004139501', '废弃电器电子产品处理资格的许可', '工作日9:00-12:00,13:00-17:00', '{"1":"行政许可事项"}', '厦门市政务服务中心三楼B厅建设综合服务区', '（1）申请废弃电器电子产品处理资格的企业应当依法成立，符合本地区废弃电器电子产品处理发展规划的要求，具有增值税一般纳税人企业法人资格。（2）具备与其申请处理能力相适应的废弃电器电子产品处理车间和场地、贮存场所、拆解处理设备及配套的数据信息管理系统、污染防治设施等；（3）具有与所处理的废弃电器电子产品相适应的分拣、包装设备以及运输车辆、搬运设备、压缩打包设备、专用容器及中央监控设备、计量设备、事故应急救援和处理设备等；（4）具有健全的环境管理制度和措施，包括对不能完全处理的废弃电器电子产品的妥善利用或者处置方案，突发环境事件的防范措施和应急预案等；（5）具有相关安全、质量和环境保护的专业技术人员；注：以下情形之一的，应当重新申请废弃电器电子产品处理资格：增加废弃电器电子产品处理类别的；新建处理设施的；改建、扩建原有处理设施的；处理废弃电器电子产品超过资格证书确定的处理能力20%以上的。', '004139501', '（1）《废弃电器电子产品回收处理管理条例》（2）《废弃电器电子产品处理资格许可管理办法》', null, '20006', '{"2":"单位"}', '{"20006":"废弃电器电子产品处理资格证书"}', '{"1":"批复"}', '{"D0000000026":"厦门市环境保护局"}', '书面审批。废弃电器电子产品处理资格以批准的期间为有效期限。无年审规定。', '{"004139501":"厦门市环境保护局"}', '{"2":"承诺件"}', null, '21个工作日', null, null, null, null, null, '{}', null, '{"XZSP_TEMPLATE":"行政审批串联流程模板"}', '{}', null, 'XZSP_TEMPLATE', '{}', '{"0":"不显示工程图列表"}', '{"1":"启用"}', '{"0":"不外网显示"}', null, null, '{}', null, '普通项目', '1', '行政许可事项', '1', '承诺件', '2', '{"1":"审批"}', '审批', '单位', '厦门市环境保护局', 'D0000000026', '厦门市环境保护局', 'D0000000026', '1', '厦门市环境保护局', '批复', null, '废弃电器电子产品处理资格证书', null, null, null, '行政审批串联流程模板', null, '不显示工程图列表', '0', '启用', '1', '不外网显示', '0', '2', '厦门市环境保护局');
