values ('68b3460759ad470cafc70f0a415719e2', 'U0010000001', to_timestamp('17-06-2014 15:19:33.947000', 'dd-mm-yyyy hh24:mi:ss.ff'), 'U0010000001', to_timestamp('25-07-2014 01:25:17.429000', 'dd-mm-yyyy hh24:mi:ss.ff'), null, '249ebde3-add9-4dbe-9b8a-6cbaa2485a56', null, null, '建设项目配套的市政工程设施建设审批', '350200004136423A110100', '{"1":"普通项目"}', null, null, null, null, null, '{"004136423":"厦门市市政园林局"}', '{"D0000000051":"厦门市市政园林局"}', '7703805', '20个工作日', '1', null, '004136423', '凡在本市城市总体规划区内的新建、改建、扩建和使用市政工程设施的建设工程项目，均应进行建设项目配套的市政工程设施建设行政审批。准予的发《厦门市市政园林工程审批意见书》。不准予的发《厦门市市政园林工程审批整改意见书》和《市政园林局审批阶段补正材料通知书》。', '工作日9:00-12:00,13:00-17:00', '{"1":"行政许可事项"}', '厦门市政务服务中心三楼B厅建设综合服务区', '满足规划部门“两证一书”要求； 建设项目配套的市政工程设施建设设计符合国家技术标准；取得相关批文：市政府核发的建设用地批复及用地红线附图；市规划局批准的《建设工程设计方案批复通知书》；工业、医疗项目需附“环评”报告；属法院拍卖项目的，须取得法院、市规划局对拍卖建设项目的相关批文等。符合以下规范：《城市道路工程设计规范》CJJ37-2012；《城市道路交叉口设计规程》CJJ152-2010；《城市道路和建筑物无障碍设计规范》（JGJ50—2001、J114—2001）；《民用建筑设计通则》BG50352--2005　；《汽车库建筑设计规范》JGJ100—98　；《建设工程设计文件编制深度规定》中华人民共和国建设部2003年4月；《室外排水设计规范》GBJ14—87（1997年版）；《室外给水设计规范》GBJ13—86；《建筑给水排水设计规范》GB50015—2003；《二次供水设施卫生规范》GB17051--1997；《污水再生利用工程设计规范》GB50335--2002；《福建省建筑工程施工图文件设计深度及总说明要求》 第一册“建筑工程建筑专业”；《厦门市城市规划管理技术规定》（厦门市规划局，二0一0年十一月）； 《城市居住区规划设计规范》GB50180—93。 ', '004136423', '《厦门市市政工程管理条例》第12、15条', null, '30025', '{"2":"单位"}', '{"30025":"厦门市市政园林工程审批意见书"}', '{"1":"批复"}', '{"D0000000051":"厦门市市政园林局"}', null, '{"004136423":"厦门市市政园林局"}', '{"2":"承诺件"}', null, '7个工作日（不包含勘察现场的3个工作日）', null, null, null, null, null, '{"5e680142-cf97-43b1-bbe4-7166fdd8bce9":"厦门市建设与管理局/建设工程施工图审查所/建设工程施工图审查","a73d581d-94c3-4768-a6e1-38c110a6a461":"厦门市公安消防支队/建设工程消防设计审核","d4404470-8d70-4cea-bf79-a25143201ffc":"厦门市通信管理局/新建（改、扩建）项目通信配套（公众电信网）建设","a7acb794-a88d-451f-8436-8a3e514e9ad7":"厦门市市政园林局/建设项目园林审批（园林施工图审查）","c4b653b2-dd32-4f3a-8735-be2656a4fcb2":"厦门市市政园林局/建设项目配套的市政工程设施建设审批","584c277c-115f-4e5e-85c4-5bac47e32b3a":"厦门市气象局/防雷装置设计审核","939b2e23-d9fc-43f2-b87d-6f7e5c5c592b":"厦门市规划局/建设工程规划许可（市政类）","4cfb5d08-03d0-4f70-b6c1-aeea63d59265":"厦门市民防局/防空地下室建设施工图审查结果备案及防空地下室