values ('d919a49a6a3344b9a65973bb7513036b', 'U0010000001', to_timestamp('17-06-2014 11:57:36.619000', 'dd-mm-yyyy hh24:mi:ss.ff'), 'U0010000001', to_timestamp('25-07-2014 01:23:46.861000', 'dd-mm-yyyy hh24:mi:ss.ff'), null, '249ebde3-add9-4dbe-9b8a-6cbaa2485a56', null, null, '占用绿地许可', '350200004136423A090000', '{"1":"普通项目"}', null, null, null, null, '城市绿化赔偿费', '{"004136423":"厦门市市政园林局"}', '{"D0000000051":"厦门市市政园林局"}', '7703805', '20个工作日。', '1', null, '004136423', '临时使用城市园林绿地。准予的发《临时使用园林绿地许可证》。不准予的发《不予批准通知书》。', '工作日9:00-12:00,13:00-17:00 ', '{"1":"行政许可事项"}', '厦门市政务服务中心三楼B厅建设综合服务区', '建设项目临时占用绿地的，须取得规划部门核发的建设用地规划许可证及建设工程规划许可证，且有以下情况之一的：施工场地狭窄，施工有困难的；需连接市政、通信、电力管线的，并已取得相关部门审批的文件和设计图纸；因项目配套的市政道路暂时无法开设，需开设临时通道的；市政公用项目临时占用绿地的，须取得规划部门核发的建设工程规划许可证；因消防、交通、工商广告等相关项目需临时占用绿地的，须取得相关部门的批准文件；以上三种情况还须满足：不得严重破坏绿化景观；重大活动期间，应按许可机关要求限制施工。（法律依据：由本实施办法规定）。', '004136423', '《城市绿化条例》第二十一条、第二十四条、第二十五条 ；《厦门市城市园林绿化条例》第二十九条、第三十二条 ；《福建省城市园林绿化管理条例》第十六条。', null, '20016', '{"3":"个人和单位"}', '{"20016":"临时使用园林绿地许可证"}', '{"2":"证照"}', '{"D0000000051":"厦门市市政园林局"}', null, '{"004136423":"厦门市市政园林局"}', '{"2":"承诺件"}', '闽价[2006]房58号', '7个工作日（不包含勘察现场的3个工作日）。', '0.6元/㎡.天', '厦门市市政园林局', null, null, null, '{}', null, '{"XZSP_TEMPLATE":"行政审批串联流程模板"}', '{}', null, 'XZSP_TEMPLATE', '{}', '{"0":"不显示工程图列表"}', '{"1":"启用"}', '{"0":"不外网显示"}', null, null, '{}', null, '普通项目', '1', '行政许可事项', '1', '承诺件', '2', '{"1":"审批"}', '审批', '个人和单位', '厦门市市政园林局', 'D0000000051', '厦门市市政园林局', 'D0000000051', '2', '厦门市市政园林局', '证照', null, '临时使用园林绿地许可证', null, null, null, '行政审批串联流程模板', null, null, null, '启用', '1', null, null, '3', '厦门市市政园林局');
