values ('f507ff722a704b7592879940e271eafb', 'U0010000001', to_timestamp('16-06-2014 17:46:55.464000', 'dd-mm-yyyy hh24:mi:ss.ff'), 'U0010000001', to_timestamp('25-07-2014 02:06:51.306000', 'dd-mm-yyyy hh24:mi:ss.ff'), null, '249ebde3-add9-4dbe-9b8a-6cbaa2485a56', null, null, '建设项目竣工环境保护验收许可', '350200004139501A090000', '{"1":"普通项目"}', null, null, null, null, null, '{"004139501":"厦门市环境保护局"}', '{"D0000000026":"厦门市环境保护局"}', null, null, '1', null, '004139501', '建设项目竣工环境保护验收许可', '工作日9:00-12:00,13:00-17:00', '{"1":"行政许可事项"}', '厦门市政务服务中心三楼B厅建设综合服务区', '（1）建设项目环境影响评价文件经过环保行政主管部门审批。（2）审批中要求的环保设施的设计、施工等资料完备，包括环保设施的设计方案、施工图，设备采购合同或发票。应配套建设的环境保护设施及措施已按经批准的环境影响评价文件及环保行政主管部门审批意见的要求建成。环境保护设施安装规范，经负荷试车检测合格，污染防治能力适应主体工程的需要。具备环境保护设施正常运转的条件，包括经过培训合格的操作人员、污染防治设施的操作规程、环保管理制度、环保岗位职责。（生产负荷达到设计能力75%，污染防治设施正常运行，稳定达标。除城市污水处理厂（不含泵站）外，分期建设的项目，可以分期验收。）（3）已按经批准的环境影响评价文件的要求有效落实各项生态保护和恢复措施。（4）污染物排放符合经批准的环境影响评价文件规定的标准及核定的污染物排放总量控制指标。环境影响评价文件要求建设单位采取措施削减其它污染物排放或要求建设项目所在地地方政府或者有关部门采取“区域削减”措施满足污染物总量控制要求的，其相应措施得到落实。（5）排污口符合《关于开展排放口规范化整治工作的通知》（国家环保部 环发[1999]24号），污染物监控措施已按经批准的环境影响评价文件要求落实。（6）环境影响评价文件提出需对环境保护敏感点进行环境影响验证，对清洁生产进行指标考核，对施工期环境保护措施落实情况进行工程监理的，已按规定完成。（7）向环境排放污染物的企业事业单位，生产、贮存、经营、使用、运输危险物品的企业事业单位，产生、收集、贮存、运输、利用、处置危险废物的企业事业单位，以及其他可能发生突发环境事件的企业事业单位，已编制环境应急预案并按规定备案，且预案中规定的各项应急建设项目和应急管理项目已建设到位。', '004139501', '（1）《中华人民共和国环境保护法》（2）《中华人民共和国水污染防治法》（3）《中华人民共和国海洋环境保护法》（4）《中华人民共和国大气污染防治法》（5）《中华人民共和国固体废物污染环境防治法》（6）《建设项目环境保护管理条例》（7）《建设项目竣工环境保护验收管理办法》（8）《突发环境事件应急预案管理暂行办法》（9）《厦门市环境保护条例》', null, '在《建设项目竣工环境保护验收申请》中书面审批', '{"2":"单位"}', '{"在《建设项目竣工环境保护验收申请》中书面审批":"在《建设项目竣工环境保护验收申请》中书面审批"}', '{"1":"批复"}', '{"D0000000026":"厦门市环境保护局"}', null, '{"004139501":"厦门市环境保护局"}', '{"2":"承诺件"}', null, '10个工作日', null, null, null, null, null, '{}', null, '{"XZSP_TEMPLATE":"行政审批/行政审批串联流程模板"}', '{}', null, 'XZSP_TEMPLATE', '{}', '{"0":"不显示工程图列表"}', '{"1":"启用"}', '{"0":"不外网显示"}', null, null, '{}', null, '普通项目', '1', '行政许可事项', '1', '承诺件', '2', '{"1":"审批"}', '审批', '单位', '厦门市环境保护局', 'D0000000026', '厦门市环境保护局', 'D0000000026', '1', '厦门市环境保护