values ('b18c65138d68481a97969fe77f2ef85c', 'U0010000001', to_timestamp('14-07-2014 17:22:21.901000', 'dd-mm-yyyy hh24:mi:ss.ff'), 'U0010000001', to_timestamp('25-07-2014 01:36:07.162000', 'dd-mm-yyyy hh24:mi:ss.ff'), null, '249ebde3-add9-4dbe-9b8a-6cbaa2485a56', null, null, '河道管理范围内工程建设方案审批', '350200004142022A090000', '{"1":"普通项目"}', null, null, null, '厦门市水利局', null, '{"004142022":"厦门市水利局"}', '{"U0010000038":"市水利局"}', '0592-7703886', '20个工作日', '1', null, '004142022', '在河道管理范围内进行工程建设的单位和个人,其工程建设方案必须经过审批。', '工作日上午9：00-12:00，下午13:00-17:00', '{"1":"行政许可事项"}', '厦门市云顶北路842号市政务服务中心三楼B厅9号窗口', '1、在河道管理范围内建设跨河、穿堤、临河的桥梁、码头、道路、渡口、管道、缆线、取水、排水等工程设施，应当符合防洪标准、岸线规划、航运要求和其他技术要求，不得危害堤防安全，影响河势稳定、妨碍行洪畅通；2、满足河道管理及防汛要求 ；3、与河道整治规划相协调；4、河道管理部门意见或河道权属证明文件。', '004142022', '1、《中华人民共和国水法》第38条2、《中华人民共和国防洪法》第27条3、《中华人民共和国河道管理条例》(国务院令第3号)第11、25条 4、《福建省水法实施办法》第33条 5、《厦门市水利工程建设与管理若干规定》（厦门市政府令第135号）第5条', null, '30009', '{"3":"个人和单位"}', '{"30009":"河道管理范围内的工程建设方案申请和审查意见书"}', '{"1":"批复"}', '{"U0010000038":"市水利局"}', '批准的工程许可文件有效期限为两年，一年内因故不能按期开工的，应向审批机关申请延期；超过期限自动失效。', '{"004142022":"厦门市水利局"}', '{"2":"承诺件"}', null, '7个工作日', null, null, null, null, null, '{}', null, '{"XZSP_TEMPLATE":"行政审批串联流程模板"}', '{}', null, 'XZSP_TEMPLATE', '{}', '{"0":"不显示工程图列表"}', '{"1":"启用"}', '{"0":"不外网显示"}', null, null, '{}', null, '普通项目', '1', '行政许可事项', '1', '承诺件', '2', '{"1":"审批"}', '审批', '个人和单位', '厦门市水利局', 'U0010000038', '市水利局', 'U0010000038', '1', '厦门市水利局', '批复', null, '河道管理范围内的工程建设方案申请和审查意见书', null, null, null, '行政审批串联流程模板', null, '不显示工程图列表', '0', '启用', '1', '不外网显示', '0', '3', '市水利局');
