values ('ba27ccad9a2d4d24bf4d4d148314169d', 'U0010000001', to_timestamp('14-07-2014 17:27:52.500000', 'dd-mm-yyyy hh24:mi:ss.ff'), 'U0010000001', to_timestamp('25-07-2014 01:36:15.636000', 'dd-mm-yyyy hh24:mi:ss.ff'), null, '249ebde3-add9-4dbe-9b8a-6cbaa2485a56', null, null, '水工程建设规划同意书审批', '350200004142022N070000', '{"1":"普通项目"}', null, null, null, '厦门市水利局', null, '{"004142022":"厦门市水利局"}', '{"U0010000038":"市水利局"}', '0592-7703886', '20个工作日', '1', null, '004142022', '在厦门市域内江河、湖泊上新建、扩建以及改建并调整原有功能的水工程建设项目审批，建设单位或责任主体在工程可行性研究阶段向有关水行政主管部门申请签署水工程建设同意书。', '工作日上午9：00-12:00，下午13:00-17:00', '{"2":"非行政许可事项"}', '厦门市云顶北路842号市政务服务中心三楼B厅9号窗口', '审批机关对其受理的水工程建设规划同意书申请，应当依据有关法律、法规、规划和技术规范进行审查；对符合下列条件的，作出批准的决定，并签署《水工程建设规划同意书》：（一）水工程建设规模、任务符合流域综合规划和防洪规划的总体要求；（二）建设规模等级（别）和标准符合《防洪标准》及其他有关技术和管理规定的要求；（三）不影响其他水工程，或者有消除影响的补救措施。', '004142022', '1、《中华人民共和国水法》（主席令第74号）第十九条；2、《中华人民共和国防洪法》（主席令第88号）十七条；3、《福建省防洪条例》第十五条；4、水利部颁布实施《水工程建设规划同意书制度管理办法（试行）》(第31号令)；5、福建省水利厅 福建省发展和改革委员会关于印发《福建省水工程建设规划同意书制度管理办法实施细则》(试行)的通知;6、厦发改综改（2012）5号。', null, '30035', '{"3":"个人和单位"}', '{"30035":"行政许可决定书"}', '{"1":"批复"}', '{"U0010000038":"市水利局"}', '有效期限为建设项目使用期限。', '{"004142022":"厦门市水利局"}', '{"2":"承诺件"}', null, '7个工作日', null, null, null, null, null, '{}', null, '{"XZSP_TEMPLATE":"行政审批串联流程模板"}', '{}', null, 'XZSP_TEMPLATE', '{}', '{"0":"不显示工程图列表"}', '{"1":"启用"}', '{"0":"不外网显示"}', null, null, '{}', null, '普通项目', '1', '非行政许可事项', '2', '承诺件', '2', '{"1":"审批"}', '审批', '个人和单位', '厦门市水利局', 'U0010000038', '市水利局', 'U0010000038', '1', '厦门市水利局', '批复', null, '行政许可决定书', null, null, null, '行政审批串联流程模板', null, '不显示工程图列表', '0', '启用', '1', '不外网显示', '0', '3', '市水利局');
