values ('25ca6afc45544e61874090967153a51c', 'U0010000001', to_timestamp('15-07-2014 09:38:47.849000', 'dd-mm-yyyy hh24:mi:ss.ff'), 'U0010000001', to_timestamp('21-07-2014 21:51:55.478000', 'dd-mm-yyyy hh24:mi:ss.ff'), null, '249ebde3-add9-4dbe-9b8a-6cbaa2485a56', null, null, '船舶装运危险品进出渔港许可', '350200004139704A090000', '{"1":"普通项目"}', null, null, null, '孙仁义', null, '{"004139704":"厦门市海洋与渔业局"}', '{"D0000000031":"厦门市海洋与渔业局"}', '2197119、13625002283', '20个工作日（不包含申请材料补正、基本符合项整改、作出行政许可的时间）', '4', null, '004139704', '船舶装运危险品进出渔港核准', '工作日9:00-12:00,13:00-17:00', '{"1":"行政许可事项"}', '市行政服务中心三楼B厅1号厦门市海洋与渔业局窗口/湖里区闽台中心渔港签证站/思明区大学路154号二楼', '1、船舶证书齐全、有效（包括：国籍证书、船舶检验证书、航行签证簿）。   捕捞渔船还须有渔业捕捞许可证。   捕捞渔船临时从事载客、载货运输时，须向船舶检验部门申请临时检验，并取得临时检验证书。   150总吨以上的油轮、400总吨以上的非油轮和主机额定功率300千瓦以上的渔业船舶，应当备有油类记录簿。   从事倾倒废弃物作业的船舶，应持有国家海洋局或其派出机构的批准文件；   2、按规定配齐船员，职务船员应持有有效的适任证书；   3、船舶处于适航状态。各种有关航行安全的重要设施及救生、消防设备按规定配备齐全，并处于良好使用状态；装载合理；按规定标写船名、船籍港和悬挂船名牌；   4、装运危险物品的船舶，其货物名称和数量应与《船舶装运危险物品准运单》所载相符，并有相应的安全保障和预防措施，按规定显示信号；   5、没有违反中华人民共和国法律、行政法规或港口管理规章的行为；   6、已交付了应承担的费用，或提供了适当的担保；   7、如发生交通事故，已按规定办理处理手续；   8、根据天气预报，海上风力没有超过船舶抗风等级。', '004139704', ' 1、《中华人民共和国海上交通安全法》第33条、第48条（1983年9月2日第六届全国人民代表大会常务委员会第二次会议通过）。  2、《中华人民共和国渔港水域交通安全管理条例》第8条（1989年7月3日国务院令第38号发布）。  3、《中华人民共和国船舶进出渔港签证办法》第9条、第10条（1990年1月26日农业部令第十一号发布，根据1997年12月25日农业部令第39号修订）', null, null, '{"2":"单位"}', '{}', '{}', '{"D0000000031":"厦门市海洋与渔业局"}', '当航次有效', '{"004139704":"厦门市海洋与渔业局"}', '{"2":"承诺件"}', null, '2个工作日', null, null, null, null, null, '{}', null, '{"XZSP_TEMPLATE":"行政审批串联流程模板"}', '{}', null, 'XZSP_TEMPLATE', '{}', '{"0":"不显示工程图列表"}', '{"1":"启用"}', '{"0":"不外网显示"}', null, null, '{}', null, '普通项目', '1', '行政许可事项', '1', '承诺件', '2', '{"4":"核准"}', '核准', '单位', '厦门市海洋与渔业局', 'D0000000031', '厦门市海洋与渔业局', 'D0000000031', null, '厦门市海洋与渔业局', null, null, null, null, null, null, '行政审批串联流程模板', null, '不显示工程图列表', '0', '启用', '1', '不外网显示', '0', '2', '厦门市海洋与渔业局');
