values ('9977cc51201948b8a04007956d89e00e', 'U0010000001', to_timestamp('15-07-2014 09:54:40.258000', 'dd-mm-yyyy hh24:mi:ss.ff'), 'U0010000001', to_timestamp('21-07-2014 21:56:58.331000', 'dd-mm-yyyy hh24:mi:ss.ff'), null, '249ebde3-add9-4dbe-9b8a-6cbaa2485a56', null, null, '渔业船舶船员考试发证', '350200004139704A070000', '{"1":"普通项目"}', null, null, null, '孙仁义', '船员证书收费', '{"004139704":"厦门市海洋与渔业局"}', '{"D0000000031":"厦门市海洋与渔业局"}', '2197119、13625002283', '20个工作日', '1', null, '004139704', '渔业船舶船员考试、发证', '工作日9:00-12:00,13:00-17:00', '{"1":"行政许可事项"}', '市行政服务中心三楼B厅1号厦门市海洋与渔业局窗口/思明区大学路154号二楼', '（一）普通船员专业基础训练考试发证   年满18岁，身体健康，能适应海上工作环境，并有渔业船员专业基础训练培训单位出具的培训合格证明。 （二）职务船员考试发证 1、年龄在十八周岁至六十周岁； 2、身体条件应当符合第四十九条规定的体格标准；3、申请甲类一、二等船长、轮机长适任证书的应当具有高中或相当于高中以上文化水平，申请驾驶员、轮机员的应当具有初中以上文化水平；  4、具备本规定要求，并经渔港监督机构认可的船员海上资历； 5、无线电话务员应当接受不少于120学时，其他职务船员应当接受不少于360学时的专业技术培训； 6、在主机总功率150千瓦以上渔业船舶工作的船员，应当持有《渔业船员专业训练合格证》；', '004139704', '1、《中华人民共和国海上交通安全法》第7条、第8条（1983年9月2日六届全国人大常委会二次会议通过，1983年9月2日7号主席令公布）。2、《中华人民共和国渔港水域交通安全管理条例》第14条（1989年5月5日国务院第40次常务会议通过，1989年7月3日国务院38号令发布）。 3、《中华人民共和国海洋渔业船员发证规定》全文。（经2006年3月16日农业部第8次常务会议审议通过，自2006年9月1日起施行）。4、《中华人民共和国渔业船舶普通船员专业基础训练考核发证办法》第3条（1998年3月2日农业部农渔发[1998]4号文发布）5、《关于修订农业行政许可规章和规范性文件的决定》第37条(2004年7月1日农业部令第38号公布）。', null, '30035;20029', '{"1":"个人"}', '{"20029":"渔业船员证书","30035":"行政许可决定书"}', '{"2":"证照"}', '{"D0000000031":"厦门市海洋与渔业局"}', '5年', '{"004139704":"厦门市海洋与渔业局"}', '{"2":"承诺件"}', '1、《中华人民共和国海洋渔业船舶船员考试发证规则》第六条。2、国家物价局、财政部《关于发布农业系统行政事业性收费项目和标准的通知》（价费字[1992]452号文）', '7个工作日', '详见“价费字[1992]452号文”', '厦门渔港监督局', '无', null, null, '{}', null, '{"XZSP_TEMPLATE":"行政审批串联流程模板"}', '{}', null, 'XZSP_TEMPLATE', '{}', '{"0":"不显示工程图列表"}', '{"1":"启用"}', '{"0":"不外网显示"}', null, null, '{}', null, '普通项目', '1', '行政许可事项', '1', '承诺件', '2', '{"1":"审批"}', '审批', '个人', '厦门市海洋与渔业局', 'D0000000031', '厦门市海洋与渔业局', 'D0000000031', '2', '厦门市海洋与渔业局', '证照', null, '行政许可决定书;渔业船员证书', null, null, null, '行政审批串联流程模板', null, '不显示工程图列表', '0', '启用', '1', '不外网显示', '0', '1', '厦门市海洋与渔业局');
