values ('33f51a8a31934d4789e9337569eaa4a1', 'U0010000001', to_timestamp('16-06-2014 15:54:38.807000', 'dd-mm-yyyy hh24:mi:ss.ff'), 'U0010000001', to_timestamp('21-07-2014 21:56:59.447000', 'dd-mm-yyyy hh24:mi:ss.ff'), null, '249ebde3-add9-4dbe-9b8a-6cbaa2485a56', null, null, '单建式人防工程竣工验收备案', '350200004138824N040000', '{"1":"普通项目"}', null, null, null, '黄群', null, '{"004138824":"厦门市人民防空办公室（市民防局）"}', '{"D0000000173":"厦门市民防局"}', '7703793 13616052004', '20个工作日', '1', null, '004138824', '项目建议书审批、可行性研究报告审批、初步设计审查、施工图设计审查', '工作日9:00-12:00,13:00-17:00', '{"2":"非行政许可事项"}', '厦门市政务服务中心三楼B厅建设综合服务区', '（一）项目建议书.符合人防工程中长期计划要求。对建设的必要性论据充分、论证准确，战备、社会和经济效益分析，以及选址、建设规模、防护等级、资金筹措等的分析真实、准确、有效。（二）可行性研究报告1、按照批准的项目建议书，委托具有相应资质的单位编制完成可行性研究报告；2、符合国土、规划、市政、电信、交通等有关部门的审查要求； 3、建设资金有保证。（三）设计审查1、初步设计审查（1）按照批准的可行性研究报告，委托具有相应资质等级的设计单位编制完成了初步设计文件；（2）初步设计文件资料齐全；（3）初步设计符合人防工程有关设计规范、标准和深度要求；（4）设计单位的资质符合要求。2、施工图设计审查（1）按照批准的初步设计文件，委托具有相应资质等级的勘察设计单位编制完成了施工图设计文件；（2）施工图设计资料齐全；（3）施工图设计符合人防工程有关设计规范、标准和深度要求；（4）设计单位的资质符合要求。', '004138824', '《福建省人民防空条例》第十四条、第十五条', null, '30015', '{"2":"单位"}', '{"30015":"厦门市单建人防工程建设意见书"}', '{"3":"其他"}', '{"D0000000173":"厦门市民防局"}', null, '{"004138824":"厦门市人民防空办公室（市民防局）"}', '{"2":"承诺件"}', null, '3个工作日', null, null, null, null, null, '{}', null, '{"XZSP_TEMPLATE":"行政审批串联流程模板"}', '{}', null, 'XZSP_TEMPLATE', '{}', '{"0":"不显示工程图列表"}', '{"1":"启用"}', '{"0":"不外网显示"}', null, null, '{}', null, '普通项目', '1', '非行政许可事项', '2', '承诺件', '2', '{"1":"审批"}', '审批', '单位', '厦门市人民防空办公室（市民防局）', 'D0000000173', '厦门市民防局', 'D0000000173', '3', '厦门市人民防空办公室（市民防局）', '其他', null, '厦门市单建人防工程建设意见书', null, null, null, '行政审批串联流程模板', null, '不显示工程图列表', '0', '启用', '1', '不外网显示', '0', '2', '厦门市民防局');
