values ('c6138bbdab500001e763186ee469b310', 'U0010000001', to_timestamp('17-03-2014 20:40:42.913000', 'dd-mm-yyyy hh24:mi:ss.ff'), 'U0010000001', to_timestamp('20-07-2014 11:31:25.827000', 'dd-mm-yyyy hh24:mi:ss.ff'), null, '76f96177-bc73-4861-ba70-5f2600a8ba76', null, null, null, '2月22日，乌克兰发生政权更迭。乌克兰议会罢黜了总统亚努科维奇，修改了宪法，将总统大选定于5月25日。克里米亚不承认乌克兰议会决定的合法性。3月6日，克里米亚议会投票通过该自治共和国加入俄联邦，并于3月16日举行公投的决议。', null, null, null, null, null, '11');
insert into UF_XZSP_MATTERS_DEF_STUFF (UUID, CREATOR, CREATE_TIME, MODIFIER, MODIFY_TIME, REC_VER, FORM_UUID, STATUS, SIGNATURE_, CLSM, CLMC, CLXZ, YJDZSL, CLBH, CLLXMC, CLLXDM, YJZZSL)
values ('13c5410691aa475a9fc6ff3f233c778a', 'U0010000001', to_timestamp('17-03-2014 20:40:42.918000', 'dd-mm-yyyy hh24:mi:ss.ff'), 'U0010000001', to_timestamp('20-07-2014 11:31:25.843000', 'dd-mm-yyyy hh24:mi:ss.ff'), null, '76f96177-bc73-4861-ba70-5f2600a8ba76', null, null, null, '国际观察团团长(波兰人)马捷乌什·比斯科尔斯基表示，克里米亚举行的公投符合所有国际准则并完全符合民主程序。 共有来自23个国家的约70名观察员前来观察克里米亚公投，包括欧洲议会议员、各国议会议员、国际法问题专家和著名政治家。俄方观察员由俄罗斯国家杜马、联邦委员会及公众院成员组成。', null, null, null, null, null, '22');
insert into UF_XZSP_MATTERS_DEF_STUFF (UUID, CREATOR, CREATE_TIME, MODIFIER, MODIFY_TIME, REC_VER, FORM_UUID, STATUS, SIGNATURE_, CLSM, CLMC, CLXZ, YJDZSL, CLBH, CLLXMC, CLLXDM, YJZZSL)
values ('c94fd060985f447a85751b4be9d15bb3', 'U0010000001', to_timestamp('17-03-2014 20:40:42.923000', 'dd-mm-yyyy hh24:mi:ss.ff'), 'U0010000001', to_timestamp('20-07-2014 11:31:25.863000', 'dd-mm-yyyy hh24:mi:ss.ff'), null, '76f96177-bc73-4861-ba70-5f2600a8ba76', null, null, null, '此前，欧盟、英国、意大利、法国和美国的代表声称，他们不承认乌克兰公投结果。克里米亚议会议长康斯坦丁诺夫表示，西方政治家有关克里米亚公投是不合法的声明是“亵渎行为”。他说，公投是绝对合法的。', null, null, null, null, null, '33');
