values ('79cb3fad144f4a42b11c7e4f30debe32', 'U0010000001', to_timestamp('16-03-2014 15:25:33.198000', 'dd-mm-yyyy hh24:mi:ss.ff'), 'U0010000001', to_timestamp('20-07-2014 11:31:26.988000', 'dd-mm-yyyy hh24:mi:ss.ff'), null, '76f96177-bc73-4861-ba70-5f2600a8ba76', null, null, null, '（1）据新华社电 中共中央总书记、国家主席、中央军委主席、中央军委深化国防和军队改革领导小组组长习近平3月15日上午主持召开中央军委深化国防和军队改革领导小组第一次全体会议并发表重要讲话。他强调，深化国防和军队改革，要坚持用强军目标审视改革、以强军目标引领改革、围绕强军目标推进改革。', null, null, null, null, null, '1');
